import React from 'react';
import Link from 'next/link';
import {ForceGraph, ForceGraphNode, ForceGraphLink} from 'react-vis-force';
import fetch from 'isomorphic-unfetch';
import people from '../data/people.json';

console.log(people);

const myTreeData = [
  {
    name: 'Top Level',
    attributes: {
      keyA: 'val A',
      keyB: 'val B',
      keyC: 'val C',
    },
    children: [
      {
        name: 'Level 2: A',
        attributes: {
          keyA: 'val A',
          keyB: 'val B',
          keyC: 'val C',
        },
      },
      {
        name: 'Level 2: B',
      },
    ],
  },
];

const PersonLink = props => (
  <li>
    <Link href="/person/[name]" as={`/person/${props.name}`}>
      <a>{props.name}</a>
    </Link>
  </li>
);

const Index = props => {
console.log(props);
  return (
    <div>
      <ForceGraph simulationOptions={{ height: 300, width: 300 }}>
        {props.nodes.each(person => (
          <ForceGraphNode node={{ id: person.id, name: person.name }} fill="red" />
        ))}
      </ForceGraph>
      <ForceGraphLink link={{ source: 'first-node', target: 'second-node' }} />
      <ul>
        <PersonLink name="Lev Parnas" />
        <PersonLink name="Donald Trump" />
        <PersonLink name="Jared Kushner" />
      </ul>
      <ul>
      {props.shows.map(person => (
        <li key={person.id}>
          <Link href="/person/[name]" as={`/person/${person.name}`}>
            <a>{person.name}</a>
          </Link>
        </li>
      ))}
    </ul>
</div>
)};

Index.getInitialProps = async function() {
//  const res = await fetch('../data/people.json');
//  const data = people.json();

//  console.log(`Show data fetched. Count: ${data.length}`);

  //console.log(data.map(entry => entry.show));
console.log(people);
  return {
    props: [],
    nodes: people,
    renderTree: true,
  };
};

export default Index;
